import React, { useState } from 'react';
import styled from 'styled-components';
import { CopyToClipboard } from 'react-copy-to-clipboard';
import { toast, ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import arrowGreen from '../../assets/icon-arrow-green.png';
import arrowBeige from '../../assets/icon-arrow-beige.png';
import kakaoPay from '../../assets/kakaopay.png';

export default function DropDown({ modifier, name, account }) {
  const [isOpen, setIsOpen] = useState(false);

  const DropDown = () => {
    setIsOpen(!isOpen);
  };

  const TOAST = {
    position: toast.POSITION.BOTTOM_CENTER,
    autoClose: 1000,
    closeButton: false,
    icon: true,
    hideProgressBar: true,
    progress: undefined,
  };

  const handleCopyClick = (isCopySuccess) => {
    if (isCopySuccess) {
      toast.success('계좌가 복사되었습니다!', TOAST);
    } else {
      toast.error('계좌 복사에 실패했습니다.', TOAST);
    }
  };

  return (
    <DropContainer>
      <StyledToastContainer />
      <GroomtCover onClick={DropDown}>
        <GroomText>신랑측</GroomText>
      </GroomtCover>
      {isOpen && (
        <NameCardContainer>
          <ul>
            <li>
              <Modifier>{modifier}</Modifier>
              <Name>{name}</Name>
              <a
                href=" https://qr.kakaopay.com/FEi3Gomyq "
                target="_blank"
                rel="noreferrer"
              >
                <PayButton src={kakaoPay} alt="카카오페이">
                  카카오페이
                </PayButton>
              </a>
              <AccountCopyContainer>
                <Account>{account}</Account>
                <CopyToClipboard text={account} onCopy={handleCopyClick}>
                  <AccountCopyButton>복사</AccountCopyButton>
                </CopyToClipboard>
              </AccountCopyContainer>
            </li>
          </ul>
        </NameCardContainer>
      )}
      <BridaltCover onClick={DropDown}>
        <BridalText>신부측</BridalText>
      </BridaltCover>
    </DropContainer>
  );
}

export const StyledToastContainer = styled(ToastContainer)`
  .Toastify__toast {
    font-size: 1rem;
    border-radius: 0.5rem;
    padding: 1rem 1.5rem;
    color: #fff;
    background: rgba(0, 0, 0, 1);
    bottom: 1rem;
  }
`;

export const DropContainer = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  margin-top: 3rem;
`;

export const GroomtCover = styled.button`
  position: relative;
  display: flex;
  align-items: center;
  width: 20rem;
  height: 3.5rem;
  background-color: #e6e7dd;

  &::after {
    content: '';
    position: absolute;
    background: url(${arrowGreen}) no-repeat center center;
    background-size: contain;
    width: 1rem;
    height: 1rem;
    right: 1rem;
  }
`;

export const GroomText = styled.h3`
  margin-left: 1rem;
  font-size: 0.9rem;
  color: #595d3b;
`;

export const BridaltCover = styled.button`
  position: relative;
  display: flex;
  align-items: center;
  width: 20rem;
  height: 3.5rem;
  background-color: #efeae2;
  margin-top: 0.5rem;
`;

export const BridalText = styled.h3`
  margin-left: 1rem;
  font-size: 0.9rem;
  color: #856442;

  &::after {
    content: '';
    position: absolute;
    background: url(${arrowBeige}) no-repeat center center;
    background-size: contain;
    width: 1rem;
    height: 1rem;
    right: 1rem;
  }
`;

export const NameCardContainer = styled.div`
  width: 100%;
  background-color: #fff;
`;

export const Modifier = styled.p``;

export const Name = styled.h3``;

export const Account = styled.span``;

export const PayButton = styled.button``;

export const AccountCopyContainer = styled.div``;

export const AccountCopyButton = styled.button``;
